import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <div>
            <img className="ui mini circular image" src="/logo192.png" />
            <h3 className="ui header">
                <Link to="/" className="item" style={{ color: '' }}>
                    KAREEM SASA'S LOG BOOK
                </Link>
            </h3>

            <Link to="/undergraduatecoursework" className="item">
                UNDERGRADUATE COURSEWORK
            </Link>
            <Link to="/projects" className="item">
                PROJECTS
            </Link>
            <Link to="/articles" className="item">
                ARTICLES
            </Link>
            <Link to="/misc" className="item">
                MISCELLANEOUS
            </Link>
        </div>
    );
};

export default Header;
